/*
 
 "I"(증가) 또는 "D"(감소) 만 포함하는 문자열 S가 주어지면 N = S.length로 합시다.
 
 모든 i = 0, ..., N-1에 대해 [0, 1, ..., N]의 순열 A를 반환합니다.
 
 S[i] == "I"이면, A[i] < A[i + 1]
 S[i] == "D"이면, A[i] > A[i + 1]
 
*/

func diStringMatch(_ S: String) -> [Int] {
    var array = Array(repeating: 0, count: S.count)
    var lowValue: Int = 0
    var hightValue: Int = S.count
    
    for i in 0..<S.count {
        if Array(S)[i] == "I" {
            array[i] = lowValue
            lowValue += 1
        } else {
            array[i] = hightValue
            hightValue -= 1
        }
    }
    
    array.append(lowValue)
    
    return array
}

